    handleBlur,
    handleChange,
    setFieldValue,
) => {
    return (
        <Box m="30px auto">
            <Box>
                <Typography sx={{ mb: "15px" }} fontSize="18px">
                    Billing Information
                </Typography>
                <AddressForm 
                    type="billingAddress"
                    values={values.billingAddress}
                    errors={errors}
                    touched={touched}
                    handleBlur={handleBlur}
                    handleChange={handleChange}
                    setFieldValue={setFieldValue}
                />
            </Box>

            <Box mb="20px">
                <FormControlLabel 
                    control={
                        <Checkbox

                        />
                    }
                />
            </Box>
        </Box>
    )
}

